import { PieChart, Pie } from "recharts";

const data = [
  { name: "Jan", val: 400 },
  { name: "Feb", val: 300 },
  { name: "Mar", val: 200 },
  { name: "Apr", val: 300 },
];

const renderSpent = (
  <PieChart width={400} height={400}>
    <Pie dataKey="val" data={data} cx={200} cy={200} fill="#000000" label />
  </PieChart>
);

export default renderSpent;
